# --- Paths ---
USER_DIR = Path(os.path.expanduser("~")) / "ProServer"
BASE_DIR = USER_DIR / "downloads"
HOST_DIR = USER_DIR / "hosted"
ETC_DIR = USER_DIR / "etc"
ZSIGN_EXE = USER_DIR / "zsign.exe"


LOCAL_IP = socket.gethostbyname(socket.gethostname())
SERVER_CODE = LOCAL_IP.replace('.', '-')
MENU_CODE_TEXT = SERVER_CODE

# --- Ensure folders exist ---
for folder in [BASE_DIR, HOST_DIR, ETC_DIR]:
    folder.mkdir(parents=True, exist_ok=True)

# --- Auto-download zsign if missing ---
ZSIGN_URL = "https://github.com/zhlynn/zsign/releases/download/v0.7/zsign-v0.7-windows-x64.zip"
if not ZSIGN_EXE.exists():
    zip_path = USER_DIR / "zsign.zip"
    print("Downloading zsign...")
    resp = requests.get(ZSIGN_URL, stream=True)
    with open(zip_path, "wb") as f:
        for chunk in resp.iter_content(8192):
            if chunk: f.write(chunk)
    print("Extracting zsign...")
    with zipfile.ZipFile(zip_path, "r") as z:
        z.extractall(USER_DIR)
    zip_path.unlink()
    print("zsign ready!")

# --- Base64 icon for tray ---
ICON_BASE64 = """

"""

def create_image():
    img_data = base64.b64decode(ICON_BASE64)
    return Image.open(io.BytesIO(img_data))

# --- Tray ---
def copy_code_to_clipboard(code: str) -> bool:
    try:
        # Windows native clipboard via clip
        subprocess.run("clip", input=code, text=True, shell=True, check=True)
        return True
    except Exception:
        try:
            # Fallback: tkinter clipboard
            from tkinter import Tk
            r = Tk(); r.withdraw()
            r.clipboard_clear(); r.clipboard_append(code); r.update(); r.destroy()
            return True
        except Exception:
            return False

def run_tray():
    icon = pystray.Icon("ProServer")
    icon.icon = create_image()

    # build_menu: text callable MUST accept one argument (pystray passes the MenuItem)
    def build_menu():
        return pystray.Menu(
            item("ProServer", lambda icon, item: None, enabled=True),
            item("", lambda icon, item: None, enabled=False),
            item(lambda mi: f"Code: {SERVER_CODE}", on_click),
            item("Quit", lambda icon, item: icon.stop())
        )

    # click handler: copy then notify
    def on_click(icon_param, item_param):
        ok = copy_code_to_clipboard(SERVER_CODE)
        try:
            if ok:
                icon_param.notify("Code copied to clipboard!")
            else:
                icon_param.notify("Failed to copy code to clipboard.")
        except Exception:
            # notify sometimes throws depending on backend; ignore to avoid crash
            pass

    icon.menu = build_menu()
    threading.Thread(target=lambda: (time.sleep(1), icon.notify(
        f"ProServer running and minimised to system tray!\nYour ProServer code is: {SERVER_CODE}"
    ))).start()
    icon.run()

# --- Helpers ---
def remove_readonly(func, path, excinfo):
    os.chmod(path, stat.S_IWRITE)
    func(path)

def clear_folder(folder):
    if folder.exists(): shutil.rmtree(folder, onerror=remove_readonly)
    folder.mkdir(parents=True, exist_ok=True)

# Clean ephemeral folders
clear_folder(BASE_DIR)
clear_folder(HOST_DIR)

# --- Flask app ---
app = Flask(__name__)

# --- helpers ---
def interpret_zsign_error(stderr_text: str):
    s = stderr_text.lower()
    if "unzip failed" in s or ("unzip" in s and "failed" in s):
        return "Failed to unzip IPA — file may be corrupted or not a valid zip/ipa."
    if "permission denied" in s:
        return "Permission denied while accessing files (check file permissions)."
    if "could not find" in s or "no such file" in s:
        return "A required file wasn't found by zsign (maybe incorrect paths)."
    if "incorrect password" in s or "bad decrypt" in s or "mac verify failure" in s:
        return "Wrong password for the .p12 private key."
    if "failed to sign" in s or ("error" in s and "signature" in s) or "error" in s:
        return "zsign failed to sign — see zsign output for details."
    return "Unknown zsign error. zsign output: " + stderr_text.strip()[:1000]

def download_url_to(url: str, dest_path: str, timeout=30):
    try:
        resp = requests.get(url, stream=True, timeout=timeout)
    except Exception as e:
        return False, f"Failed to reach URL {url}: {e}"
    if resp.status_code != 200:
        return False, f"Download returned status {resp.status_code} for {url}"
    try:
        with open(dest_path, "wb") as f:
            for chunk in resp.iter_content(chunk_size=8192):
                if chunk:
                    f.write(chunk)
    except Exception as e:
        return False, f"Failed writing downloaded data: {e}"
    return True, None

def filename_from_url(url: str, fallback_name: str):
    p = urlparse(url)
    name = os.path.basename(p.path)
    if not name:
        return fallback_name
    return name

def extract_info_from_ipa(ipa_path):
    """Return (bundle_id, bundle_version, title) or (None, None, None) on failure."""
    try:
        with zipfile.ZipFile(ipa_path, 'r') as z:
            for name in z.namelist():
                if name.count('/') >= 2 and name.lower().startswith("payload/") and name.lower().endswith(".app/info.plist"):
                    with z.open(name) as f:
                        data = f.read()
                        info = plistlib.loads(data)
                        bundle_id = info.get("CFBundleIdentifier") or info.get("CFBundleExecutable")
                        bundle_version = info.get("CFBundleShortVersionString") or info.get("CFBundleVersion")
                        title = info.get("CFBundleDisplayName") or info.get("CFBundleName") or os.path.basename(ipa_path)
                        return bundle_id, bundle_version, title
    except Exception:
        pass
    return None, None, None

def build_manifest(bundle_identifier: str, bundle_version: str, title: str, ipa_url: str) -> bytes:
    manifest = {
        'items': [
            {
                'assets': [
                    {
                        'kind': 'software-package',
                        'url': ipa_url
                    }
                ],
                'metadata': {
                    'bundle-identifier': bundle_identifier,
                    'bundle-version': bundle_version,
                    'kind': 'software',
                    'title': title
                }
            }
        ]
    }
    return plistlib.dumps(manifest)

def create_manifest_and_links(new_id: str, bundle_identifier: str, bundle_version: str, title: str, base_url: str, storage_dir: Path) -> dict:
    """
    Create <id>.plist in storage_dir and return URLs + itms install link.
    base_url must include scheme (e.g. "https://example.com") and will be used to build manifest/ipa/install URLs.
    """
    storage_dir.mkdir(parents=True, exist_ok=True)
    manifest_url = f"{base_url.rstrip('/')}/manifest/{new_id}.plist"
    ipa_url = f"{base_url.rstrip('/')}/ipa/{new_id}.ipa"
    manifest_data = build_manifest(bundle_identifier, bundle_version, title, ipa_url)
    manifest_path = storage_dir / f"{new_id}.plist"
    manifest_path.write_bytes(manifest_data)
    itms_link = f"itms-services://?action=download-manifest&url={quote(manifest_url, safe='')}"
    return {
        'id': new_id,
        'manifest_path': str(manifest_path),
        'manifest_url': manifest_url,
        'ipa_url': ipa_url,
        'itms_link': itms_link,
        'bundle_identifier': bundle_identifier,
        'bundle_version': bundle_version,
        'title': title
    }

# --- cleanup thread for HOST_DIR (remove older than TTL_SECONDS) ---
def hosted_cleanup_worker():
    while True:
        now = time.time()
        try:
            for entry in os.scandir(HOST_DIR):
                if not entry.is_dir():
                    continue
                mtime = os.path.getmtime(entry.path)
                if now - mtime > TTL_SECONDS:
                    print("Deleting old .ipa files!")
                    shutil.rmtree(entry.path, ignore_errors=True)
        except Exception:
            pass
        time.sleep(30)

cleanup_thread = threading.Thread(target=hosted_cleanup_worker, daemon=True)
cleanup_thread.start()

@atexit.register
def cleanup_on_exit():
    try:
        shutil.rmtree(HOST_DIR, ignore_errors=True)
    except Exception:
        pass

# --- main endpoint: supports file/url inputs + password text/file/url, plus type=file|install (default file) ---
@app.route("/api", methods=["POST"])
def upload_and_sign():
    expected_ext = {"p12": ".p12", "mobileprovision": ".mobileprovision", "ipa": ".ipa"}
    req_type = (request.form.get("type") or "file").lower()

    uid = str(uuid.uuid4())
    save_dir = os.path.join(BASE_DIR, uid)
    os.makedirs(save_dir, exist_ok=True)

    try:
        inputs = {}
        missing = []
        for key, ext in expected_ext.items():
            if key in request.files and request.files[key].filename:
                upfile = request.files[key]
                filename = secure_filename(upfile.filename)
                dest_name = filename if filename.lower().endswith(ext) else f"{key}{ext}"
                dest = os.path.join(save_dir, dest_name)
                upfile.save(dest)
                inputs[key] = dest
            else:
                url_field = request.form.get(f"{key}_url") or request.form.get(f"{key}url") or request.form.get(key+"_url")
                if url_field:
                    parsed = urlparse(url_field)
                    if parsed.scheme not in ("http", "https"):
                        return jsonify({"status":"error","message":f"{key}_url must be http or https"}), 400
                    inferred = filename_from_url(url_field, f"{key}{ext}")
                    if not inferred.lower().endswith(ext):
                        inferred = f"{key}{ext}"
                    dest = os.path.join(save_dir, secure_filename(inferred))
                    ok, err = download_url_to(url_field, dest)
                    if not ok:
                        return jsonify({"status":"error","message":f"Failed to download {key} from URL","detail":err}), 400
                    inputs[key] = dest
                else:
                    missing.append(key)

        # password handling: priority text->file->url
        password = None
        password_text = request.form.get("password")
        if password_text:
            password = password_text
        elif "password_file" in request.files and request.files["password_file"].filename:
            pf = request.files["password_file"]
            dest_pf = os.path.join(save_dir, secure_filename(pf.filename) or "password.txt")
            pf.save(dest_pf)
            with open(dest_pf, "r", encoding="utf-8", errors="ignore") as f:
                password = f.read().strip()
        else:
            pw_url = request.form.get("password_url") or request.form.get("passwordurl")
            if pw_url:
                parsed = urlparse(pw_url)
                if parsed.scheme not in ("http", "https"):
                    return jsonify({"status":"error","message":"password_url must be http or https"}), 400
                dest_pw = os.path.join(save_dir, "password.txt")
                ok, err = download_url_to(pw_url, dest_pw)
                if not ok:
                    return jsonify({"status":"error","message":"Failed to download password from URL","detail":err}), 400
                with open(dest_pw, "r", encoding="utf-8", errors="ignore") as f:
                    password = f.read().strip()
            else:
                missing.append("password")

        if missing:
            return jsonify({"status":"error","message":f"Missing required inputs (file or url): {', '.join(missing)}"}), 400

        for k, p in inputs.items():
            if not os.path.isfile(p):
                return jsonify({"status":"error","message":f"{k} file missing after save/download."}), 500
            if not p.lower().endswith(expected_ext[k]):
                return jsonify({"status":"error","message":f"{k} must end with {expected_ext[k]} (got {os.path.basename(p)})"}), 400

        if not password:
            return jsonify({"status":"error","message":"Password not provided or empty."}), 400

        if not os.path.isfile(ZSIGN_EXE):
            return jsonify({"status":"error","message":"zsign.exe not found in current directory."}), 500

        unsigned_ipa = inputs["ipa"]
        signed_ipa_tmp = os.path.join(save_dir, "signed.ipa")

        cmd = [ZSIGN_EXE, "-k", inputs["p12"], "-p", password, "-m", inputs["mobileprovision"], "-o", signed_ipa_tmp, unsigned_ipa]
        try:
            proc = subprocess.run(cmd, stdout=subprocess.PIPE, stderr=subprocess.PIPE, timeout=240)
        except subprocess.TimeoutExpired:
            for k in ("p12", "mobileprovision"):
                try: os.remove(inputs.get(k, "")) 
                except Exception: pass
            return jsonify({"status":"error","message":"zsign timed out.","reason":"zsign did not finish within the allowed time."}), 504

        stdout = proc.stdout.decode(errors="ignore")
        stderr = proc.stderr.decode(errors="ignore")
        rc = proc.returncode

        if rc != 0 or not os.path.isfile(signed_ipa_tmp):
            for k in ("p12", "mobileprovision"):
                try: os.remove(inputs.get(k, "")) 
                except Exception: pass
            reason = interpret_zsign_error(stderr or stdout)
            return jsonify({"status":"error","message":"zsign failed.","returncode":rc,"reason":reason,"zsign_stdout":stdout[:3000],"zsign_stderr":stderr[:3000]}), 500

        # type=file -> send signed ipa and remove everything
        if req_type == "file":
            @after_this_request
            def cleanup(response):
                try:
                    if os.path.isdir(save_dir):
                        shutil.rmtree(save_dir, ignore_errors=True)
                except Exception:
                    pass
                return response
            return send_file(signed_ipa_tmp, as_attachment=True, download_name=f"signed_{os.path.basename(unsigned_ipa)}")

        # type=install -> host signed ipa + manifest, return JSON with urls + itms link; do NOT create HTML page
        elif req_type == "install":
            hosted_id = str(uuid.uuid4())
            hosted_folder = Path(HOST_DIR) / hosted_id
            hosted_folder.mkdir(parents=True, exist_ok=True)

            target_ipa = hosted_folder / f"{hosted_id}.ipa"
            shutil.move(signed_ipa_tmp, str(target_ipa))

            bundle_id, bundle_version, title = extract_info_from_ipa(str(target_ipa))
            bundle_id = bundle_id or request.form.get("bundle_identifier") or f"com.example.{hosted_id}"
            bundle_version = bundle_version or request.form.get("bundle_version") or "1.0"
            title = title or request.form.get("title") or f"App {hosted_id}"

            base_url = (request.host_url or "").rstrip("/")
            data = create_manifest_and_links(hosted_id, bundle_id, bundle_version, title, base_url, hosted_folder)

            # delete sensitive bits & unsigned ipa
            try:
                for k in ("p12", "mobileprovision"):
                    p = inputs.get(k)
                    if p and os.path.exists(p):
                        os.remove(p)
                pwf = os.path.join(save_dir, "password.txt")
                try:
                    if os.path.exists(pwf): os.remove(pwf)
                except Exception: pass
                try:
                    if os.path.exists(unsigned_ipa): os.remove(unsigned_ipa)
                except Exception: pass
                try:
                    if os.path.isdir(save_dir):
                        shutil.rmtree(save_dir, ignore_errors=True)
                except Exception:
                    pass
            except Exception:
                pass

            return jsonify({"status":"success", **data})

        else:
            try:
                if os.path.isdir(save_dir):
                    shutil.rmtree(save_dir, ignore_errors=True)
            except Exception:
                pass
            return jsonify({"status":"error","message":"Unknown type. Use 'file' or 'install'."}), 400

    except Exception as e:
        try:
            if os.path.isdir(save_dir):
                shutil.rmtree(save_dir, ignore_errors=True)
        except Exception:
            pass
        return jsonify({"status":"error","message":"Internal server error.","detail":str(e)}), 500

# --- endpoints to serve hosted ipa and plist ---
@app.route("/ipa/<id>.ipa", methods=["GET"])
def serve_ipa(id):
    p = Path(HOST_DIR) / id
    ipa = p / f"{id}.ipa"
    if ipa.exists():
        return send_file(str(ipa), as_attachment=True, download_name=f"{id}.ipa")
    abort(404)

@app.route("/manifest/<id>.plist", methods=["GET"])
def serve_manifest(id):
    p = Path(HOST_DIR) / id
    plist = p / f"{id}.plist"
    if plist.exists():
        return send_file(str(plist), as_attachment=False, download_name=f"{id}.plist")
    abort(404)

# --- Run ---
if __name__ == "__main__":
    threading.Thread(target=lambda: app.run(host="0.0.0.0", port=8030, debug=False, threaded=True), daemon=True).start()
    run_tray()